class Solution:
    def lastSubstring(self, s: str) -> str:
        char = ''
        for i in range(122, 96, -1):
            if chr(i) in s:
                char = chr(i)
                print(char, i)
                break

        substr = []
        i = s.index(char)
        n = len(s)
        j = i + 1
        while i < n:
            while j < n and s[j] == s[j-1]:
                j += 1
            substr.append(i)
            j+= 1

            while j < n and s[j] != char:
                j += 1
            i = j
            j += 1

        ret = s[substr[0]:]
        for i in substr[1:]:
            print(s[i:])
            ret = max(ret, s[i:])
        return ret


